import styled from 'styled-components'

export const Nav = styled.nav`
    width:100%;
    height:5vh;
    background-color:#f5f7f7;
`

export const LoginButton = styled.button`
    height:40px;
    width:300px;
    border-width:0px;
    border-radius:6px;
    background-color: #2587d9;
    margin-top:26px;
`
